import React, {Component} from 'react';
import './bootstrap.css';
import Form from './form.js'
import PDF0 from './form/0.pdf';
import IMG0 from './image/form/0.png';
import './img.css';

class Section extends Component{

  render(){
    const doctors = [
      {
        'name' : 'Nathan Sumilang',
        'description' : 'TODO'
      },
      {
        'name' : 'Gwenith Cancino',
        'description' : 'TODO description'
      }
    ];
    //TODO : Add images to the slideshow
    const slideImages = [
      {
        'url' : 'TODO URL',
        'alt' : 'Alt Image'
      }
    ];
    return(
      //<AboutUs />
      <section className="container-fluid">
        <Home id="home" images={slideImages} />
        <Doctor id="about" doctor={doctors} />
        <Form />
        <ContactUs id="contact"/>
      </section>
    );
  }
}

const Home = props => {
  const images = props.images.map((image, index) =>{
    return(
      <div id="home" className="col-md-12">
      </div>
    );
  });
  return <section id="home" className="row">{images}</section>
};


const Doctor = props =>{
  const doctors = props.doctor.map((doctor, index) =>{
    return(
      <div key={index} className="col-md-6 text-center">
        <div>{doctor.name}</div>
        <div>{doctor.description}</div>
      </div>
    );
  });
  return <section id="doctors" className="row">
        <h1 className="col-md-12 text-center">Meet Our Doctors</h1>
        {doctors}</section>
};


const ContactUs = () =>{
  return(
    <section id="contact" className="row">
      <h1 className="col-md-12 text-center">Contact Us</h1>
      <div className="col-md-6 text-center">
        <h5>Email: </h5>
        <h5>Phone Number: </h5>
      </div>
      <div className="col-md-6 text-center">
        <h5>Address: </h5>
        <p>Address Line 1</p>
        <p>City, State Zip</p>
      </div>
    </section>
  );
}

export default Section;
